// Cambia las URLs por las de tus productos reales cuando las tengas
const images = [
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTzSoOvkBffIumB-mHUm4o-iQDxhKLH2w5Qtg&s", // Tu imagen subida
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTf691xVLoB3usC-xmv5lmAsdMETlo9nsyNTQ&s", // Frappé/Granizado
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQRnOPR97CwTqsekSbW7_FOINJIl2z4LZ_xlw&s", // Helado
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT4u6NBZntVSBkiydCyplrzFo9OTP1m6SmtlQ&s", // Paleta
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRt6x7gOb5SOjmxNrwsT-XkoJIw6iNZF2ibfQ&s", // Galletas/dulces
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTuZDeLzODtqBgNF5nLRFQYh5H7Xqgf8yQaaw&s", // Maracumango/vaso colorido
];

const instagramUrl = "https://www.instagram.com/tu_usuario/"; // Cambia por tu IG real
const [selectedImg, setSelectedImg] = useState(null);
<img
  src={img}
  onClick={() => setSelectedImg(img)}
  className="cursor-pointer w-full h-56 object-cover rounded-2xl shadow-lg transition-transform duration-300 hover:scale-105"
/>

const GallerySection = () => (
<section className="py-16 px-4 sm:px-6 lg:px-8 bg-gradient-to-br from-orange-50 to-yellow-50 text-center">
  <h2 className="text-5xl font-extrabold text-gray-900 mb-10 drop-shadow-lg tracking-tight relative inline-block">
    <span className="bg-gradient-to-r from-orange-500 via-yellow-400 to-pink-500 bg-clip-text text-transparent">Momentos Olè Mita</span>
  </h2>
  <div className="grid grid-cols-2 sm:grid-cols-3 gap-8 max-w-4xl mx-auto">
    {images.map((img, idx) => (
      <a
        key={idx}
        href={instagramUrl}
        target="_blank"
        rel="noopener noreferrer"
        className="group relative rounded-3xl overflow-hidden shadow-xl hover:shadow-2xl transition-all"
        style={{ animationDelay: `${idx * 80}ms` }}
      >
        <img
          src={img}
          alt={`ole mita galería ${idx + 1}`}
          className="w-full h-56 object-cover transition-transform duration-300 group-hover:scale-110"
        />
        {/* Overlay Instagram */}
        <div className="absolute inset-0 bg-black bg-opacity-0 group-hover:bg-opacity-40 flex items-center justify-center transition-all duration-300">
          <svg
            className="opacity-0 group-hover:opacity-100 w-16 h-16 text-white transition-all duration-300"
            fill="currentColor"
            viewBox="0 0 24 24"
